import React, { useState, useEffect } from 'react';

const AsignacionEmprendimiento = ({ navigate }) => {
    const [evaluadores, setEvaluadores] = useState([]);
    const [emprendimientos, setEmprendimientos] = useState([]);
    const [selectedEvaluador, setSelectedEvaluador] = useState('');
    const [selectedEmprendimientos, setSelectedEmprendimientos] = useState([]);
    const [assignments, setAssignments] = useState([]);
    const [disabledEvaluadores, setDisabledEvaluadores] = useState([]);
    const [disabledEmprendimientos, setDisabledEmprendimientos] = useState([]);

    useEffect(() => {
        fetchEvaluadores();
        fetchEmprendimientos();
    }, []);

    const fetchEvaluadores = async () => {
        // Simulando una llamada a la API
        const response = {
            ok: true,
            data: [
                {
                    _id: "668d9256a9e4591afd2ba890",
                    nombre: "Evaluador 1",
                    idIES: "66736b2317fb868463e7e60c",
                    telefono: "telEval1",
                    correo: "correoEval1@correo.com",
                    idPais: "66736b2317fb868463e7e60c"
                },
                {
                    _id: "668d943f6376d4e5b7d5c029",
                    nombre: "Evaluador 2",
                    idIES: "66736fde17fb868463e7e613",
                    telefono: "telEval2",
                    correo: "correoEval2@correo.com",
                    idPais: "66736b2317fb868463e7e60c"
                }
            ]
        };
        setEvaluadores(response.data);
    };

    const fetchEmprendimientos = async () => {
        const response = {
            "ok": true,
            "data": [
                {
                    "proyectosNoAsociados": [
                        {
                            "_id": "669822307dd98655ecb51880",
                            "idSector": "66957196c82228c4e3901648",
                            "idIES": "66957e598d1d1da498ff9a49",
                            "idEmprendedor": "66957f838d1d1da498ff9a5d",
                            "fecha": "2011/11/11",
                            "fechaInscripcion": 2024,
                            "estado": "Crecimiento",
                            "numeroEmprendimiento": 4,
                            "__v": 0
                        },
                        {
                            "_id": "6698223f7dd98655ecb5189a",
                            "idSector": "66957196c82228c4e3901648",
                            "idIES": "66957e598d1d1da498ff9a49",
                            "idEmprendedor": "66957f838d1d1da498ff9a5d",
                            "fecha": "2012/12/12",
                            "fechaInscripcion": 2024,
                            "estado": "Crecimiento",
                            "numeroEmprendimiento": 5,
                            "__v": 0
                        },
                        {
                            "_id": "6699b17e7dd98655ecb518b4",
                            "idSector": "66957196c82228c4e3901648",
                            "idIES": "66957e8d8d1d1da498ff9a4b",
                            "idEmprendedor": "66957fbf8d1d1da498ff9a5f",
                            "fecha": "2012/12/12",
                            "fechaInscripcion": 2024,
                            "estado": "Lanzamiento Temprano",
                            "numeroEmprendimiento": 6,
                            "__v": 0
                        }
                    ]
                }
            ],
            "message": "OK - Búsqueda de proyectos no asociados a la IES del evaluador",
            "error": null
        };
        setEmprendimientos(response.data[0].proyectosNoAsociados);
    };

    const handleEvaluadorChange = (e) => {
        setSelectedEvaluador(e.target.value);
        setSelectedEmprendimientos([]);
    };

    const handleEmprendimientoChange = (e) => {
        const emprendimientoId = e.target.value;
        setSelectedEmprendimientos(prev =>
            prev.includes(emprendimientoId)
                ? prev.filter(id => id !== emprendimientoId)
                : [...prev, emprendimientoId]
        );
    };

    const handleAsignar = () => {
        if (selectedEvaluador && selectedEmprendimientos.length > 0) {
            console.log('Evaluador ID:', selectedEvaluador);
            console.log('Emprendimientos IDs:', selectedEmprendimientos);

            const evaluador = evaluadores.find(e => e._id === selectedEvaluador);
            const asignadosEmprendimientos = emprendimientos.filter(e => selectedEmprendimientos.includes(e._id));

            const newAssignment = {
                evaluador: evaluador.nombre,
                evaluadorId: evaluador._id,
                emprendimientos: asignadosEmprendimientos
            };

            setAssignments(prev => [...prev, newAssignment]);
            setDisabledEvaluadores(prev => [...prev, evaluador._id]);
            setDisabledEmprendimientos(prev => [...prev, ...selectedEmprendimientos]);
            setSelectedEvaluador('');
            setSelectedEmprendimientos([]);
        } else {
            console.error('Debes seleccionar un evaluador y al menos un emprendimiento');
        }
    };

    return (
        <div>
            <h2>Asignar Evaluadores</h2>
            <div>
                <label htmlFor="evaluador">Seleccione un evaluador:</label>
                <select
                    id="evaluador"
                    value={selectedEvaluador}
                    onChange={handleEvaluadorChange}
                >
                    <option value="">Seleccione un evaluador</option>
                    {evaluadores.map(evaluador => (
                        <option
                            key={evaluador._id}
                            value={evaluador._id}
                            disabled={disabledEvaluadores.includes(evaluador._id)}
                        >
                            {evaluador.nombre}
                        </option>
                    ))}
                </select>
            </div>
            <div>
                <p>Seleccione los emprendimientos:</p>
                {emprendimientos.map(emprendimiento => (
                    <div key={emprendimiento._id}>
                        <input
                            type="checkbox"
                            id={emprendimiento._id}
                            value={emprendimiento._id}
                            checked={selectedEmprendimientos.includes(emprendimiento._id)}
                            onChange={handleEmprendimientoChange}
                            disabled={disabledEmprendimientos.includes(emprendimiento._id)}
                        />
                        <label htmlFor={emprendimiento._id}>
                            Emprendimiento {emprendimiento.numeroEmprendimiento} - {emprendimiento.estado}
                        </label>
                    </div>
                ))}
            </div>
            <button onClick={handleAsignar}>Asignar</button>
            <button onClick={() => navigate('inicio_admin')}>Regresar</button>

            {assignments.length > 0 && (
                <div>
                    <h3>Asignaciones realizadas:</h3>
                    <ul>
                        {assignments.map((assignment, index) => (
                            <li key={index}>
                                {assignment.evaluador}: 
                                {assignment.emprendimientos.map(e => ` Emprendimiento ${e.numeroEmprendimiento}`).join(', ')}
                            </li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default AsignacionEmprendimiento;
